import {useState, useEffect} from 'react'

 function Card() {
    useEffect(() => {
        fetch(`../logements.json`)
             .then((response) => response.json()
             .then(({ logements }) => console.log(logements))
             .catch((error) => console.log(error))
         )
     }, [])
 }

 export default Card
